pragma solidity ^0.8.24;
contract buyBook{
    uint _bookPrice = 0;
    uint amount=100;
    function get( uint price)payable public returns(uint){
        amount -=price;
        return amount;
    }
    function bookAddress()public payable returns(uint){
         _bookPrice;
        return amount;
    }
}

